import React,{Component} from 'react'
import PosteData from '../data/posts.json'

function PostList () {
  return (
    <div>
      
      {PosteData.map((postdetail,index)=>{
          return <div>
              <h1>{postdetail.title}</h1>
              <h2>{postdetail.content}</h2>
          </div>
          
      })}
    </div>
  );
}

export default PostList;
